// src/components/LandingPage.js
import React from 'react';
import './LandingPage.css'; // Import your CSS file for styling
import profileImage from '../assets/profile.jpeg'; // Import your profile image\
import { FaGraduationCap, FaEnvelope, FaPhone, FaMusic } from 'react-icons/fa';
import { FaBookOpen } from "react-icons/fa";
import { FcCellPhone } from "react-icons/fc";
import { FcReadingEbook } from "react-icons/fc";
import { FcMusic } from "react-icons/fc";
import { FcAddressBook } from "react-icons/fc";



const LandingPage = () => {
  const scrollToProjects = () => {
    const projectsSection = document.getElementById('projects-section');
    projectsSection.scrollIntoView({ behavior: 'smooth' });

  };

  return (
    <div className="landing-page">
      <div className="landing-page-content">
        <div className="profile-image-container">
          <img src={profileImage} alt="Profile" className="profile-image" />
        </div>
        <h1>Hi, I am <span style={{display: 'inline-block'}} class="rainbow">Ashish</span>.</h1>
        <h2>I am a Software Engineer excited to showcase my projects.</h2>
        <span><h2><FaGraduationCap style={{marginRight: '0.5em'}}/></h2> <h4> Masters in Computer Science</h4></span>
        <h4><FcReadingEbook style={{marginRight: '0.5em'}}/>Arizona State University</h4>
        <h4><FcAddressBook style={{marginRight: '0.5em'}}/>akuma347@asu.edu</h4>
        <h4><FcCellPhone style={{marginRight: '0.5em'}}/>+1 (480)-798-8547</h4>
        <h4><FcMusic style={{marginRight: '0.5em'}}/>Listening to music </h4>
        <button className="cta-button" onClick={scrollToProjects}>View Projects</button>
      </div>
    </div>
  );
}

export default LandingPage;
